import React from 'react'
import { Container, Row, Col } from 'reactstrap';
import '../Page1/index.css'


export default class Page1 extends React.Component{
    render(){
        return(
            <Container>
                <Row class="class header">
                    <Col className="header">header</Col>
                </Row>
                <Row>
                    <Col>Contents</Col>
                </Row>
            </Container>
        );
    }
}
